                    <p>Descrição teste</p>

                    <strong>Valor:</strong>
                    <p>R$ 0,00 </p>

                    <button type="button">
                        <FiTrash2 size={20} color="#a8a8b3" />
                    </button>
                </li>

                <li>
                    <strong>Caso: </strong>
